Actualmente se realizaron <b>4 muestreos</b>, en los que se recolectaron <b>32 muestras de agua</b>.

En todos los casos, no se aprecia presencia de nubes sobre los puntos de toma de muestras.

Los ocho sitios muestrales se nombran correlativamente de `P1` a `P8`, iniciando en la provincia del Chaco con y finalizando en la provincia de Corrientes.

# Firmas espectrales {#sec-firmas-espectrales}

A partir de los valores de píxel de las reflectancias de superficie ([$\S$@sec-base-de-datos]) se construyen firmas espectrales, que permiten inferir las características del agua. Las firmas espectrales a lo largo de la transecta en el río Paraná sirven para ver el cambio entre costas.

